const API_URL = 'http://localhost:3000'

export  function fetchAPI() {
     fetch(`${API_URL}/api/testAPI`)
    .then ((data) => {
        console.log(data);
        console.log("parsing");
    })
    .then((res) => {
        return res.json();
    })
    .then((response) => {
        console.log(response.json()); 
    })
}
